This is the version updated to 2013 standard in June 2013.

The Class 67 comes in six liveries with an outstanding array of immersive features such as advanced operating controls, realistic systems and authentic sounds. 

The detailed IPA Car Carriers are complete with custom sounds and can be hauled unloaded or loaded with three different models of car. Several scenarios for two of the default routes are included.


Please support the developers and buy some of their content if you can afford it.


Please use the email address for requests and questions and if you want to share an addon with the community then contact us and we will post it on your behalf. If you would like to contribute, please read the readme.pdf.


